        private HashFunction GetSHA3HashFunction(int digestSize)
        {
            return new HashFunction()
            {
                DigestSize = digestSize,
                Capacity = 2 * digestSize,
                XOF = false
            };
        }

        private HashFunction GetSHAKEHashFunction(int digestSize, int capacity)
        {
            return new HashFunction()
            {
                DigestSize = digestSize,
                Capacity = capacity,
                XOF = true
            };
        }
